n>  </td> <td>                               <span> 0.86&#034; x 15.74&#034; x 10.84&#034; / 21.9 mm x 399.9 mm x 275.4 mm </span>  </td> </tr>   <tr> <td class="a-text-bold">                               <span> WEIGHT </span>  </td> <td>                               <span> 7.05 lbs / 3.2 kgs </span>  </td> </tr>  </table> </div>  </div> </div>    <script type="text/javascript">(function(f) {var _np=(window.P._namespace("PremiumAplusModule"));if(_np.guardFatal){_np.guardFatal(f)(_np);}else{f(_np);}}(function(P) {
